Lesbian Vampire Killers (2009)  

Verenigd Koninkrijk
Komedie / Horror
88 minuten

geregisseerd door Phil Claydon
met Paul McGann, James Corden en MyAnna Buring

Terwijl hun vrouwen onder een vloek van een stel lesbische vampieren verkeren, sturen hun mannen twee onwetenden mannen uit Wales op hen af. Dit bij wijze van offer aan hen en om zodoende de vloek te kunnen breken...


